function Nav() {
  return (
    <div className="w-full h-20 border-2 shadow-2xl flex items-center ">
      <div className="flex flex-row bg-black "> 
        <div className="w-1/3 bg-red-300 ">
          <h1>TradEdge</h1>
        </div>
        <div className="w-2/3 bg-blue-200 flex flex-row justify-end gap-20 ">
          <div>Courses</div>
          <div>Services</div>
          <div>Blogs</div>
          <div>About us</div>
        </div>
      </div>
    </div>
  );
}

export default Nav;
